export default (state, action) => {
  switch (action.type) {
    case "REMOVE_ITEM":
      return {
        //   일단은 현재 state 써줘야 됨, 그리고 바꾸고 싶은 state 속의 value, 여기서는 transactions
        ...state,
      };
    default:
      return state;
  }
};
